import React from 'react';
import { connect } from 'react-redux';
import SideBar from './SideBar';
import * as TYPES from '../../Redux/Actions/actionTypes';
import {
  Clients,
  Employees,
  Feedbacks,
  Materials,
  Orders,
  Profiles,
  Promos,
  Qualifications,
  Schedules,
  Services,
  Specializations,
} from './';

class StaffMainMenu extends React.PureComponent {
  render() {
    var activeOption;
    switch (this.props.activeMenu) {
      case TYPES.CLIENTS_FETCH_DATA_SUCCESS:
        activeOption = <Clients />;
        break;

      case TYPES.MATERIALS_FETCH_DATA_SUCCESS:
        activeOption = <Materials />;
        break;

      case TYPES.SERVICES_FETCH_DATA_SUCCESS:
        activeOption = <Services />;
        break;

      case TYPES.ORDERS_FETCH_DATA_SUCCESS:
        activeOption = <Orders />;
        break;

      case TYPES.SHCEDULES_FETCH_DATA_SUCCESS:
        activeOption = <Schedules />;
        break;

      case TYPES.PROFILES_FETCH_DATA_SUCCESS:
        activeOption = <Profiles />;
        break;

      case TYPES.PROMOS_FETCH_DATA_SUCCESS:
        activeOption = <Promos />;
        break;

      case TYPES.FEEDBACKS_FETCH_DATA_SUCCESS:
        activeOption = <Feedbacks />;
        break;

      case TYPES.STAFFS_FETCH_DATA_SUCCESS:
        activeOption = <Employees />;
        break;

      case TYPES.SPECIALIZATIONS_FETCH_DATA_SUCCESS:
        activeOption = <Specializations />;
        break;

      case TYPES.QUALIFICATION_FETCH_DATA_SUCCESS:
        activeOption = <Qualifications />;
        break;

      // case TYPES.MEDIAFILES_FETCH_DATA_SUCCESS:
      //   activeOption = <Media
      //   break;

      // case TYPES.MANUFACTURER_FETCH_DATA_SUCCESS:
      //   activeOption = <Mamufacturers/>
      //   break;

      default:
        break;
    }
    return (
      <>
        <div mainWindow>
          <div>
            <SideBar />
          </div>
          <div></div>
        </div>
      </>
    );
  }
}

function mapStateToProps(state) {
  return {
    activeMenu: state.activeMenu,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(StaffMainMenu);
